import React from 'react'
import GoogleMapReact from 'google-map-react'
import './GoogleMap.scss'

const Map = ({ location, zoomLevel, ...props }) => (
  <div className={`google-map ${props.className}`}>
    <GoogleMapReact
      bootstrapURLKeys={{ key: 'AIzaSyCDQY2Gatxh38awcCqZzSBF-BgwZzV2HVk' }}
      defaultCenter={{
        lat: 59.95,
        lng: 30.33
      }}
      defaultZoom={11}
    >
      {/* <LocationPin
        lat="37.42216"
        lng="-122.08427"
        text='troloroo'
      /> */}
    </GoogleMapReact>
  </div>
)

export default Map;
